Hide the Link column'=>'Skrytí sloupce Odkaz','Show X items by default'=>'Zobrazení X položek ve výchozím nastavení','Field Visibility'=>'Pole Viditelnost','Image and Carousel options'=>'Možnosti obrázků a karuselů','Responsivity Settings'=>'Nastavení responzivity','Items (Tablet)'=>'Položky (Tablet)','Items (Mobile)'=>'Položky (mobilní telefon)','(Tick this if you want to open your links in a new window)'=>'(Zaškrtněte, pokud chcete odkazy otevřít v novém okně)','Hide the address field'=>'Skrytí pole adresy','Link text'=>'Text odkazu','Enabling this setting will prevent any infowindows from opening for all your maps'=>'Povolením tohoto nastavení zabráníte otevření všech informačních oken pro všechny vaše mapy','Infowindow Style'=>'Styl okna Infowindow','Default Infowindow'=>'Výchozí informační okno','Modern Infowindow'=>'Moderní informační okno','Modern Plus Infowindow'=>'Infokino Modern Plus','Circular Infowindow'=>'Kruhové informační okno','Prevents the larger image lightbox from opening up when pictures in the infowindow or marker listing are clicked'=>'Zabraňuje otevření většího lightboxu s obrázky při kliknutí na obrázky v infokně nebo ve výpisu značek','No Global Setting'=>'Žádné globální nastavení','Resize Images'=>'Změna velikosti obrázků','Resize all images to the below sizes'=>'Změňte velikost všech obrázků na níže uvedené velikosti','Default Image Width'=>'Výchozí šířka obrázku','(can be left blank - max width will be limited to max infowindow width)'=>'(lze ponechat prázdné - maximální šířka bude omezena na maximální šířku informačního okna)','Default Image Height'=>'Výchozí výška obrázku','(can be left blank - leaving both the width and height blank will revert to full size images being used)'=>'(lze ponechat prázdné - ponecháním prázdné šířky i výšky se vrátí k použití obrázků v plné velikosti)','Max InfoWindow Width'=>'Maximální šířka informačního okna','Other settings'=>'Ostatní nastavení','Open links in a new window '=>'Otevřít odkazy v novém okně ','Use this setting if you are experiencing Google Maps API issues, such as invalid key warnings, or Multiple API warnings'=>'Toto nastavení použijte, pokud máte problémy s rozhraním Google Maps API, například varování o neplatném klíči nebo varování o vícenásobném rozhraní API','Check this setting to disable two finger pan on mobiles, and Ctrl + Zoom on desktops. Enabling this setting will allow one finger panning on mobiles, and will enable zoom without Ctrl on desktops.'=>'Zaškrtnutím tohoto nastavení zakážete posouvání dvěma prsty na mobilních telefonech a Ctrl + Zoom na stolních počítačích. Povolením tohoto nastavení se na mobilních telefonech povolí posouvání jedním prstem a na stolních počítačích se povolí zoomování bez použití klávesy Ctrl.','Disable Lightbox'=>'Zakázat Lightbox','<strong>Minimal</strong> - The same as Compact, but with icons instead of text labels.'=>'<strong>Minimální</strong> - Stejné jako Kompaktní, ale s ikonami místo textových popisků.','<strong>Modern</strong> - Puts components inside the map, with pull-out panels.'=>'<strong>Moderní</strong> - Umístění komponent uvnitř mapy s výsuvnými panely.','<strong>Compact</strong> - Puts all components and their labels inline.'=>'<strong>Kompaktní</strong> - všechny součásti a jejich popisky jsou v řádku.','<strong>Default</strong> - The default front end.'=>'<strong>Default</strong> - Výchozí front end.','Looking for more themes? <a href="%s" target="_BLANK">Browse our theme directory</a>.'=>'Hledáte další témata? <a href="%s" target="_BLANK">Projděte si náš adresář motivů</a>.','Enter theme JSON data manually'=>'Ručně vložit data JSON do motivu','PHP 8 includes significant changes from PHP 7, which may cause unexpected issues with our core functionality. WP Go Maps is not officially supported with PHP 8, but support will be added in the near future.'=>'PHP 8 obsahuje oproti PHP 7 významné změny, které mohou způsobit neočekávané problémy s našimi základními funkcemi. WP Google Maps nejsou oficiálně podporovány v PHP 8, ale v blízké budoucnosti bude podpora přidána.','To continue using WP Go Maps, please downgrade to PHP 7, as it is fully supported by our plugin.'=>'Chcete-li i nadále používat WP Google Maps, přejděte prosím na PHP 7, protože náš plugin jej plně podporuje.','Autocomplete disabled. <a href="%s" target="_BLANK">Find out more</a>.'=>'Automatické dokončování je zakázáno.  <a href="%s" target="_BLANK">Zjistěte více</a>.','This address could not be found. WP Go Maps uses a 3rd party service (eg Google) to convert addresses to geographic coordinates. Unfortunately, the service has no records for this address at present. Please try an alternative format, or manually position the marker using right click.'=>'Tuto adresu se nepodařilo najít. WP Mapy Google používají k převodu adres na zeměpisné souřadnice službu třetí strany (např. Google). Tato služba bohužel v současné době nemá pro tuto adresu žádné záznamy. Zkuste prosím použít alternativní formát nebo značku umístěte ručně pomocí pravého tlačítka myši.','Radius:'=>'Poloměr:','Are you sure you want to delete this map?'=>'Opravdu chcete tuto mapu odstranit?','Are you sure you want to delete these maps?'=>'Opravdu chcete tyto mapy odstranit?','<strong>Legacy</strong> - This setting is the same as Default, but provides options to change individual components to the modern style.'=>'<strong>Legacy</strong> - Toto nastavení je stejné jako výchozí, ale poskytuje možnosti změny jednotlivých komponent na moderní styl.','<strong>Bare Bones</strong> - Applies no styling to the components at all. This is recommended for designers and developers who want to style the components from scratch.'=>'<strong>Barevný</strong> - Na součásti není použit žádný styl. Doporučuje se pro návrháře a vývojáře, kteří chtějí komponenty stylovat od začátku.','You have not entered a <b>Google Maps API Key</b>.<br /><br />Please go to the your admin area, then Maps, then Settings, then the Advanced tab to <a href="%s">enter your Google Maps API key</a>.<br /><br />Alternatively, <a href="%s">choose the Open Layers engine</a> to avoid getting an API key.'=>'Nezadali jste <b>klíč Google Maps API</b>.<br /><br />Přejděte do své administrátorské oblasti, pak do Map, pak do Nastavení a na kartu Rozšířené <a href="%s">zadejte svůj klíč Google Maps API</a>.<br /><br />Případně <a href="%s">zvolte engine vrstev</a>, abyste se vyhnuli zadávání klíče API.','Not available while using the OpenLayers engine.'=>'Není k dispozici při použití enginu OpenLayers.','Please ensure you <a href="%s">enter a Google Maps API key</a> to continue using Google Maps. Alternatively, swap over to Open Layers by clicking <a id="wpgm-swap-to-open-layers" href="%s">here</a>.'=>'Pro další používání Map Google se ujistěte, že jste <a href="%s">zadali klíč Google Maps API</a>. Případně přejděte na aplikaci Open Layers kliknutím <a id="wpgm-swap-to-open-layers" href="%s">sem</a>.','once off!'=>'jednou vypnout!','Geocoding this address failed. Please check you have enabled the Geocoding API for your Google Maps API project.'=>'Geokódování této adresy se nezdařilo. Zkontrolujte prosím, zda máte v projektu Google Maps API povoleno rozhraní Geocoding API.','Geocode was not successful for the following reason: '=>'Geokódování nebylo úspěšné z následujícího důvodu ','Duplicate custom field names, please ensure you only add unique custom field names.'=>'Duplicitní názvy vlastních polí, dbejte na to, abyste přidávali pouze jedinečné názvy vlastních polí.','Some interactions are disabled.'=>'Některé interakce jsou zakázány.','Interactions Enabled'=>'Povolené interakce','Re-Enable Interactions'=>'Znovu povolit interakce','Have a sales question? Contact Nick on <a href="mailto:nick@wpgmaps.com">nick@wpgmaps.com</a> or use our <a href="https://www.wpgmaps.com/contact-us/" target="_BLANK">contact form</a>.'=>'Máte dotaz k prodeji? Kontaktujte Nicka na <a href="mailto:nick@wpgmaps.com">nick@wpgmaps.com</a> nebo použijte náš <a href="https://www.wpgmaps.com/contact-us/" target="_BLANK">kontaktní formulář</a>.','Need help? <a href="https://www.wpgmaps.com/forums/" target="_BLANK">Ask a question on our support forum</a>.'=>'Potřebujete pomoc? Položte <a href="https://www.wpgmaps.com/forums/" target="_BLANK">dotaz na našem fóru podpory</a>.','Free updates and support forever'=>'Bezplatné aktualizace a podpora navždy','Once you\'re a pro user, you\'ll receive free updates and support forever! You\'ll also receive amazing specials on any future plugins we release.'=>'Jakmile se stanete profesionálním uživatelem, získáte bezplatné aktualizace a podporu navždy! Získáte také úžasné slevy na všechny budoucí pluginy, které vydáme.','Upgrade Now'=>'Upgradovat nyní','We pride ourselves on providing quick and amazing support. <a target="_BLANK" href="http://wordpress.org/support/view/plugin-reviews/wp-google-maps?filter=5">Read what some of our users think of our support</a>.'=>'Jsme hrdí na to, že poskytujeme rychlou a úžasnou podporu. <a target="_BLANK" href="http://wordpress.org/support/view/plugin-reviews/wp-google-maps?filter=5">Přečtěte si, co si o naší podpoře myslí někteří uživatelé</a>.','Easy Upgrade'=>'Snadná aktualizace','You\'ll receive a download link immediately. Simply upload and activate the Pro plugin to your WordPress admin area and you\'re done!'=>'Ihned obdržíte odkaz ke stažení. Jednoduše nahrajte a aktivujte plugin Pro do administrace WordPressu a je hotovo!','Export your markers to a CSV file for quick and easy editing. Import large quantities of markers at once.'=>'Exportovat značky do souboru CSV pro rychlé a snadné úpravy. Importovat velké množství značek najednou.','Add KML &amp; Fusion Tables'=>'Přidání KML &amp; Tabulky Fusion','Add your own KML layers or Fusion Table data to your map'=>'Přidání vlastních vrstev KML nebo dat Fusion Table do mapy','Polygons and Polylines'=>'Mnohoúhelníky a křivky','Add custom polygons and polylines to your map by simply clicking on the map. Perfect for displaying routes and serviced areas.'=>'Jednoduchým kliknutím na mapu můžete přidat vlastní polygony a křivky. Ideální pro zobrazení tras a obsluhovaných oblastí.','Amazing Support'=>'Úžasná podpora','Create and assign categories to your markers which can then be filtered on your map.'=>'Vytvářejte a přiřazujte kategorie ke značkám, které pak můžete na mapě filtrovat.','Advanced options'=>'Rozšířené možnosti','Enable advanced options such as showing your visitor\'s location, marker sorting, bicycle layers, traffic layers and more!'=>'Povolte pokročilé možnosti, jako je zobrazení polohy návštěvníka, třídění značek, vrstvy jízdních kol, dopravní vrstvy a další!','Import / Export'=>'Import / Export','Add titles, descriptions, HTML, images, animations and custom icons to your markers.'=>'Přidejte do značek názvy, popisy, HTML, obrázky, animace a vlastní ikony.','Allow your visitors to get directions to your markers. Either use their location as the starting point or allow them to type in an address.'=>'Umožněte návštěvníkům získat pokyny k vašim značkám. Jako výchozí bod použijte jejich polohu nebo jim umožněte zadat adresu.','Create as many maps as you like.'=>'Vytvořte si libovolný počet map.','Choose between three methods of listing your markers.'=>'Můžete si vybrat ze tří způsobů zápisu značek.','Add categories to your markers'=>'Přidávání kategorií do značek','Create custom markers with detailed info windows'=>'Vytváření vlastních značek s podrobnými informačními okny','Use two fingers to move the map'=>'Mapou pohybujte dvěma prsty','Use ctrl + scroll to zoom the map'=>'Pro přiblížení mapy použijte kombinaci kláves CTRL + rolovací kolečko','OR'=>'NEBO','New Map'=>'Nová mapa','Invalid theme data'=>'Neplatná data vzhledu','<strong>WP Go Maps:</strong> Execution time limit was reached whilst generating XML cache. This has been switched back to the Database method in Maps -> Settings -> Advanced'=>'<strong>WP Mapy Google:</strong> Při generování mezipaměti XML bylo dosaženo časového limitu provádění. Bylo přepnuto zpět na databázovou metodu v Mapy -&gt; Nastavení -&gt; Pokročilé','<strong>WP Go Maps:</strong> Allowed memory size was reached whilst generating XML cache. This has been switched back to the Database method in Maps -> Settings -> Advanced'=>'<strong>WP Mapy Google:</strong> Při generování mezipaměti XML bylo dosaženo povolené velikosti paměti. Bylo přepnuto zpět na databázovou metodu v Mapy -&gt; Nastavení -&gt; Pokročilé','This operation is not reversable. We recommend you take a backup before proceeding. Would you like to continue?'=>'Tuto operaci nelze zvrátit. Před pokračováním doporučujeme provést zálohu. Chcete pokračovat?','Other Caching'=>'Další ukládání do mezipaměti','Flush'=>'Pročistit','Miscellaneous Settings'=>'Různá nastavení','Always rebuilds combined script files and script cache, does not load combined and minified scripts. Includes database query SQL with REST API responses.'=>'Vždy obnoví kombinované soubory skriptů a mezipaměť skriptů, nenačítá kombinované a minifikované skripty. Obsahuje databázový dotaz SQL s odpověďmi rozhraní REST API.','This API key can be obtained from 
						the <a href=\'https://wpgmaps.com/google-maps-developer-console/\' target=\'_BLANK\'>Google Developers Console</a>. Our <a href=\'https://docs.wpgmaps.com/creating-a-google-maps-api-key\' target=\'_BLANK\'>documentation</a> provides a full guide on how to obtain this.'=>'Tento klíč API lze získat z 
						v <a href=\'https://wpgmaps.com/google-maps-developer-console/\' target=\'_BLANK\'>konzole Google Developers Console</a>. V naší <a href=\'https://docs.wpgmaps.com/creating-a-google-maps-api-key\' target=\'_BLANK\'>dokumentaci</a> najdete úplný návod, jak jej získat.','Blue'=>'Modrá','Looking for styling settings? Try our new <a href=\'%s\' target=\'_blank\'>User Interface Style</a> setting.'=>'Hledáte nastavení stylů? Vyzkoušejte naše nové nastavení <a href=\'%s\' target=\'_blank\'>stylu uživatelského rozhraní</a>.','Maps Engine'=>'Mapový modul','User Interface Style'=>'Styl uživatelského rozhraní','Use FontAwesome'=>'Použití aplikace FontAwesome','Tile Server URL'=>'Adresa URL dlaždicového serveru','Load Maps Engine API'=>'Rozhraní API pro načítání map','Always include engine API on pages'=>'Na stránkách vždy uvádějte rozhraní API engine','Always exclude engine API on pages'=>'Vždy vyloučit rozhraní API engine na stránkách','Prevent other plugins and theme loading API'=>'Zabránění načítání API jiných pluginů a motivů','Admin'=>'Admin','Editor'=>'Editor','Author'=>'Autor','Contributor'=>'Přispěvatel','Subscriber'=>'Odběratel','Hover'=>'Přejetí myší','Add Beautiful Marker Listings
			</a> 
			to your maps with the Pro version for only $39.99 once off. Support and updates included forever.'=>'<a>Přidat seznamy krásných značek</a> 
			 
