. Kontaktujte prosím svého hostitele a požádejte ho o povolení této knihovny.','I agree for my personal data to be processed by {COMPANY_NAME}.
		
I agree for my personal data, provided via map API calls, to be processed by the API provider, for the purposes of geocoding (converting addresses to coordinates), reverse geocoding and generating directions.

Some visual components of WP Go Maps use 3rd party libraries which are loaded over the network. At present the libraries are Google Maps, Open Street Map, jQuery DataTables and FontAwesome. When loading resources over a network, the 3rd party server will receive your IP address and User Agent string amongst other details. Please refer to the Privacy Policy of the respective libraries for details on how they use data and the process to exercise your rights under the GDPR regulations.

WP Go Maps uses jQuery DataTables to display sortable, searchable tables, such as that seen in the Advanced Marker Listing and on the Map Edit Page. jQuery DataTables in certain circumstances uses a cookie to save and later recall the "state" of a given table - that is, the search term, sort column and order and current page. This data is help in local storage and retained until this is cleared manually. No libraries used by WP Go Maps transmit this information.

Please <a href="https://developers.google.com/maps/terms">see here</a> and <a href="https://maps.google.com/help/terms_maps.html">here</a> for Google\'s terms. Please also see <a href="https://policies.google.com/privacy?hl=en-GB&amp;gl=uk">Google\'s Privacy Policy</a>. We do not send the API provider any personally identifying information, or information that could uniquely identify your device.

Where this notice is displayed in place of a map, agreeing to this notice will store a cookie recording your agreement so you are not prompted again.'=>'Souhlasím, aby mé osobní údaje zpracovávala společnost {COMPANY_NAME}.
		
Souhlasím s tím, aby mé osobní údaje poskytnuté prostřednictvím volání mapového API byly zpracovávány poskytovatelem API pro účely geokódování (převod adres na souřadnice), reverzního geokódování a generování směrů.

Některé vizuální součásti WP Google Maps používají knihovny třetích stran, které se načítají přes síť. V současné době se jedná o tyto knihovny: Google Maps, Open Street Map, jQuery DataTables a FontAwesome. Při načítání zdrojů přes síť obdrží server třetí strany mimo jiné vaši IP adresu a řetězec User Agent. Podrobnosti o způsobu použití údajů a postupu při uplatňování vašich práv podle nařízení GDPR naleznete v zásadách ochrany osobních údajů příslušných knihoven.

WP Mapy Google používá jQuery DataTables k zobrazení tříditelných tabulek s možností vyhledávání, například v pokročilém výpisu značek a na stránce s úpravami mapy. jQuery DataTables za určitých okolností používá soubor cookie k uložení a pozdějšímu vyvolání "stavu" dané tabulky - tj. vyhledávacího výrazu, sloupce a pořadí třídění a aktuální stránky. Tato data pomáhají v místním úložišti a uchovávají se, dokud je ručně nevymažete. Žádná knihovna používaná aplikací WP Google Maps tyto informace nepřenáší.

