itialized because the Maps API has not been loaded. Please check your settings.'=>'Mapu nelze inicializovat, protože nebylo načteno rozhraní Maps API. Zkontrolujte prosím své nastavení.','Maps API Error'=>'Chyba rozhraní API Mapy','One or more error(s) have occured attempting to initialize the Maps API:'=>'Při pokusu o inicializaci rozhraní API Maps došlo k jedné nebo více chybám:','This dialog is only visible to administrators'=>'Tento dialog je viditelný pouze pro správce','Dismiss'=>'Skrýt','API Dashboard'=>'Panel API','Verify Project'=>'Ověřit projekt','Thank you for using <a href=\'https://www.wpgmaps.com\'>WP Go Maps</a>! Please <a href=\'https://wordpress.org/support/plugin/wp-google-maps/reviews/\'>rate us on WordPress.org</a>'=>'Děkujeme, že používáte <a href=\'https://www.wpgmaps.com\'>WP Mapy Google</a>! Prosím, <a href=\'https://wordpress.org/support/plugin/wp-google-maps/reviews/\'>ohodnoťte nás na WordPress.org</a>','Please refer to our <a href=\'https://www.wpgmaps.com/privacy-policy\' target=\'_blank\'>Privacy Policy</a> for information on Data Processing'=>'Informace o zpracování údajů naleznete v našich <a href=\'https://www.wpgmaps.com/privacy-policy\' target=\'_blank\'>Zásadách ochrany osobních údajů</a>','General Complicance'=>'Obecná stížnost','Require consent before loading Maps API'=>'Vyžadování souhlasu před načtením rozhraní API Mapy','The GDPR views IP Addresses as Personal Data, which requires consent before being processed. Loading the Google Maps API stores some user information, such as IP Addresses. WP Go Maps endeavours to uphold the spirit of data protection as per the GDPR. Enable this to option to prevent the Maps API from loading, until a user has consented to it.'=>'Nařízení GDPR považuje IP adresy za osobní údaje, k jejichž zpracování je třeba souhlasu. Při načítání rozhraní Google Maps API se ukládají některé informace o uživatelích, například IP adresy. WP Mapy Google se snaží dodržovat ducha ochrany údajů podle GDPR. Povolením této možnosti zabráníte načítání rozhraní API Map, dokud k tomu uživatel nedá souhlas.','GDPR Consent Notice'=>'Oznámení o souhlasu s GDPR','The GDPR regulates that you need to state why you are processing data.'=>'GDPR stanoví, že musíte uvést, proč údaje zpracováváte.','Override GDPR Notice'=>'Zrušení oznámení GDPR','By checking this box, you agree to take sole responsibility for GDPR Compliance with regards to this plugin.'=>'Zaškrtnutím tohoto políčka souhlasíte s tím, že přebíráte výhradní odpovědnost za dodržování GDPR v souvislosti s tímto pluginem.','Override Text'=>'Přepsat text','For more information about WPGM and GDPR compliance, please refer to our <a href="https://www.wpgmaps.com/gdpr/">GDPR information page</a> and our <a href="https://www.wpgmaps.com/privacy-policy/">Privacy Policy</a>'=>'Další informace o společnosti WPGM a dodržování GDPR naleznete na naší <a href="https://www.wpgmaps.com/gdpr/">informační stránce o GDPR</a> a v našich <a href="https://www.wpgmaps.com/privacy-policy/">zásadách ochrany osobních údajů</a>','<p>
