ikty s tisíci tématy a dalšími pluginy na trhu.','Common issues:'=>'Běžné problémy:','My map is not showing on my website'=>'Na mých webových stránkách se nezobrazuje mapa','My markers are not showing on my map in the front-end'=>'Moje značky se nezobrazují na mapě ve front-endu','I\'m getting jQuery errors showing on my website'=>'Na mých webových stránkách se zobrazují chyby jQuery','Still need help? Use one of these links below.'=>'Stále potřebujete pomoc? Použijte jeden z těchto odkazů níže.','Support forum'=>'Fórum podpory','Contact us'=>'Kontaktujte nás','View this link'=>'Zobrazit tento odkaz','Delete this marker'=>'Odstranit tuto značku','My Markers'=>'Moje značky','Linked to'=>'Souvisí s','GPS'=>'GPS','Pic'=>'Img','Edit Marker Location'=>'Upravit umístění značky','Marker Latitude'=>'Značka LAT','Marker Longitude'=>'Značka LON','Save Marker Location'=>'Uložit umístění značky','Tip: Use your mouse to change the location of the marker. Simply click and drag it to your desired location.'=>'Tip: Umístění značky můžete změnit pomocí myši. Jednoduše na ni klikněte a přetáhněte ji na požadované místo.','The map could not load.'=>'Mapu se nepodařilo načíst.','This is normally caused by a conflict with another plugin or a JavaScript error that is preventing our plugin\'s Javascript from executing. Please try disable all plugins one by one and see if this problem persists. If it persists, please contact nick@wpgmaps.com for support.'=>'Obvykle je to způsobeno konfliktem s jiným zásuvným modulem nebo chybou JavaScriptu, která brání spuštění našeho zásuvného modulu. Zkuste prosím postupně vypnout všechny zásuvné moduly a zjistěte, zda tento problém přetrvává. Pokud přetrvává, obraťte se na podporu na adrese nick@wpgmaps.com.','The plugin directory does not have \'write\' permissions. Please enable \'write\' permissions (755) for '=>'Adresář zásuvných modulů nemá oprávnění k zápisu. Povolte prosím oprávnění \'zapisovat\' (755) pro ','in order for this plugin to work! Ple